import React from "react";
import styled from "styled-components";

const INFO = styled.div`
      &:before {
        content: '${props => props.before}'
      }
      `


class RegistrationStep4 extends React.Component{

    constructor(props){
      super(props);
      
    }
    
    

    render(){
        return(
            <>
                <h1 className="header-title">Review your <span className="header-title-yellow">details</span></h1>
                <div className="review-details">
                    <INFO className="info-field" before="Full Name">Juan Santos Dela Cruz</INFO>
                    <INFO className="info-field" before="Full Name">MM/DD/YY</INFO>
                </div>
            </>
        )
    }
}

export default RegistrationStep4;
